#include<iostream>
#include <vector>
#include <stdexcept>
#include <cassert>
using namespace std;

std::vector<int> Range(int from, int to, int step) {
    std::vector<int> result;
    if (step > 0) {
        for (int i = from; i < to; i += step) {
            result.push_back(i);
        }
    } else if (step < 0) {
        for (int i = from; i > to; i += step) {
            result.push_back(i);
        }
    }
    return result;
}

void print_vector(const std::vector<int>& v) {
    for (const int& item : v) {
        cout << item << " ";
    }
    cout << "\n";
}


int main() {
    {
        std::vector<int> expected{2, 3, 4};
        std::vector<int> result = Range(2, 5, 1);
        assert(expected == result);
    }
    {
        std::vector<int> expected{1, 3};
        std::vector<int> result = Range(1, 5, 2);
        assert(expected == result);
    }
    {
        std::vector<int> expected{-9, -4, 1, 6};
        std::vector<int> result = Range(-9, 10, 5);
        assert(expected == result);
    }
    
    {
        std::vector<int> expected{5, 4, 3};
        std::vector<int> result = Range(5, 2, -1);
        assert(expected == result);
    }
    {
        std::vector<int> expected{5, 3};
        std::vector<int> result = Range(5, 1, -2);
        assert(expected == result);
    }
    
    std::cout << "All tests passed!" << std::endl;
    
    return 0;
}




